import * as type from './types';
import photos from '../apis/photos';

export const signIn = (userId) => {
  return {
    type: type.SIGN_IN,
    payload: userId,
  };
};

export const signOut = () => {
  return {
    type: type.SIGN_OUT,
  };
};

export const createPhoto = (formValues) => {
  return {
    type: type.CREATE_PHOTO,
    payload: formValues,
  };
};
